import React, { Component } from "react";
import logo from "./logo.png";
import "./App.css";


class App extends Component {
  render() {
    return (
      <div id="App">
        <div id="AppHeader">
          <img src={logo} id="AppLogo" alt="logo" />
          <h2>PawFinder</h2>
          <p>Swipe left until you find a Pet you like then swipe right!</p>
        </div>
        <div id="contentDiv"></div>
        <div id="footer"></div>
      </div>
    );
  }
}

export default App;
